import { useState } from "react";

const data = [
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
];

const ImageSlider = () => {
  const [index, setIndex] = useState(0);
  const onPrevClick = () => {
    setIndex((prev) => {
      if (prev === 0) {
        return data.length - 1;
      }
      return prev - 1;
    });
  };

  const onNextlick = () => {
    setIndex((prev) => (prev + 1) % data.length);
  };
  return (
    <div>
      <button onClick={onPrevClick}> Prev </button>
      {data.map((img, ind) => {
        console.log("index === ind", index === ind);
        return (
          <img
            key={ind}
            src={img}
            loading="lazy"
            style={{
              height: "100px",
              width: "100px",
              display: index === ind ? "block" : "none",
            }}
          />
        );
      })}
      <button onClick={onNextlick}> Next </button>
    </div>
  );
};

export default ImageSlider;
